import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { HomeUI } from "./Home";
import { SignUpUI } from "./SignUp";
import { SignInUI } from "./SignIn";
import { CreateNoteUI } from "./CreateNote";

const Stack = createNativeStackNavigator();

function App() {

 const ui = (

  <NavigationContainer>
    <Stack.Navigator>
      <Stack.Screen name="Notes List" component={HomeUI}/>
      <Stack.Screen name="Sign Up" component={SignUpUI}/>
      <Stack.Screen name="Sign In" component={SignInUI}/>
      <Stack.Screen name="Create New Note" component={CreateNoteUI}/>
    </Stack.Navigator>
  </NavigationContainer>
 );

  return ui;
}

export default App;
